import React, {FC} from 'react';
import Toe from "./Toe";

export interface GameProps {
    onClick?: () => void,
    width?: string,
    height?: string,
    onMouseEnterFunc?: () => void
}

const Game: FC<GameProps> = (
    {
        onClick,
        width = '300px',
        height = '300px',
        onMouseEnterFunc
    }) => {
    return (
        <div
            onClick={onClick}
            onMouseEnter={onMouseEnterFunc}
            style={{
                width,
                height,
                border: '2px solid black',
                display: 'flex',
                flexWrap:'wrap',
                alignItems:'center',
                justifyContent:'center'

            }}
        >
            <Toe index={1}/><Toe index={2}/><Toe index={3}/>
            <Toe index={4}/><Toe index={5}/><Toe index={6}/>
            <Toe index={7}/><Toe index={8}/><Toe index={9}/>
        </div>
    );

};

export default Game;
